import React from 'react';
import './App.css';

function Box_Head(props){
  return (
    <tr>
     {props.head.map((item)=>{<th>item</th>})}
    </tr>
  );
}


function Box(props){
  let head = ["No","Name", "Person", "Type", "Other"];
  return (
    <table className="table table-striped">
      <Box_Head head={head}/>
      <tr> 
        <td>{props.num}</td>
        <td>{props.name}</td>
        <td>{props.person}</td>
        <td>{props.amount}</td>
        <td>{props.other}</td>
      </tr>
    </table>
  );
}

function App() {
  return (
    <div className="App">
    <h1>Hello</h1>
    <Box num="2" name="mike" person="lola's human" amount="100%"/>
    </div>
  );
}

export default App;
